import React from 'react';
import './App.css';

function App() {
  return(
    <div className="wrapper">

      <form>
      <fieldset>

         <label> Name:
           <input name="name" />
          </label>
          <br></br>

         <label>
           State:
           <input address="address"/>
         </label>
         <br></br>

         <label>
           Phone No:
           <input number="address"/>
         </label>
         <br></br>

         <label>
           Address:
           <input address="address"/>
         </label>

       </fieldset>
       <button type="submit">Submit</button>
      </form>
    </div>
  )
}

export default App;
